import React from 'react'

const Guess = (props) => {
  return (
    <div class='felx flex-col'>
     
      {new Array(10).fill(0).map((_,i)=>(
        <div>{props.guess[i]}</div>
      ))}
    </div>
  )
}

export default Guess
